import React, { useState } from 'react';

import { useDispatch } from 'react-redux';

import styled from '@emotion/styled';
import {
    Box,
    InputBase
} from '@mui/material/index';

import SearchIcon from '../assets/icons/search';
import { setFilterData } from '../store/reducers/tableData';

const SearchBar = styled(Box)({
    width: 631,
    height: 52,
    marginLeft: 78,
    background: '#5A5C66',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: 15,

});

const SearchText = styled(InputBase)({
    color: '#B2B7BF',
    marginLeft: 26,
});

const SearchIcons = styled(SearchIcon)({
    color: '#FFFFFF',
    marginRight: 24,
});


function Search(): React.ReactElement {
    const dispatch = useDispatch();
    const [value, setValue] = useState("");


    return <SearchBar>
        <SearchText
            placeholder='Поиск'
            onChange={(event) => setValue(event.target.value)}
            onKeyPress={(e) => {
                console.log(e.key)
                    (e.key === 'Enter') && dispatch(setFilterData(value))
            }}
        />
        <SearchIcons onClick={dispatch(setFilterData(value))} />
    </SearchBar>
};

export default Search;
